import React from 'react';
import "./Header.css";
import HeaderLeft from '../../images/top-left.PNG';
import HeaderRight from '../../images/top-right.PNG';
import Logo from '../../images/logo.PNG';

const Header = () => {
  return (
      <div className='header'>
            <div className='container-fluid'>
                <div className='row'>
                    <div className='col-md-2'>
                        <img src={HeaderLeft} className='img-fluid' alt='header-left' />
                    </div>
                    <div className='col-md-8 text-center text-uppercase'>
                        <h6>seal ... shield ... feel</h6>
                        <img src={Logo} className='img-fluid' alt='logo' />
                        <p>solo masterpiece</p>
                    </div>
                    <div className='col-md-2 text-end header-right'>
                        <img src={HeaderRight} className='img-fluid' alt='Header-right' />
                    </div>
                </div>       
            </div>

            <div className='footer text-center'>
                <p>HYDRACTIV</p>
            </div>
            
      </div>
  )
}

export default Header;
